package com.qhc.order.entity;import java.io.Serializable;import java.util.Date;/** *  * Function: Data transfer object. <br>  * * @author walker */public class DeliveryAddress		implements Serializable {	private static final long serialVersionUID = -2407475667810784999L;		/* Id */	private Integer id = null;	/* 订单详情id */	private Integer orderInfoId = null;	/* 序号，每个订单详情从1开始，每增加一条取本订单的最大值加一 */	private Integer seq = null;	/* 省 */	private String provinceCode = null;	/* 市 */	private String cityCode = null;	/* 区 */	private String districtCode = null;	/* 地址 */	private String address = null;	public DeliveryAddress(){	}	public Integer getId() {		return this.id;	}	public void setId(Integer id) {		this.id = id;	}	 	public Integer getOrderInfoId() {		return this.orderInfoId;	}	public void setOrderInfoId(Integer orderInfoId) {		this.orderInfoId = orderInfoId;	}	 	public Integer getSeq() {		return this.seq;	}	public void setSeq(Integer seq) {		this.seq = seq;	}	 	public String getProvinceCode() {		return this.provinceCode;	}	public void setProvinceCode(String provinceCode) {		this.provinceCode = provinceCode;	}	 	public String getCityCode() {		return this.cityCode;	}	public void setCityCode(String cityCode) {		this.cityCode = cityCode;	}	 	public String getDistrictCode() {		return this.districtCode;	}	public void setDistrictCode(String districtCode) {		this.districtCode = districtCode;	}	 	public String getAddress() {		return this.address;	}	public void setAddress(String address) {		this.address = address;	}	 	@Override	public int hashCode() {		final int prime = 31;		int result = 1;		result = prime * result + ((id == null) ? 0 : id.hashCode());		return result;	}	@Override	public boolean equals(Object obj) {		if (this == obj) {			return true;		}		if (obj == null) {			return false;		}		if (getClass() != obj.getClass()) {			return false;		}		final DeliveryAddress other = (DeliveryAddress) obj;		return (this.id == null ? other.id == null : this.id.equals(other.id));	}		public String toString() {	    final String tab = "  ";	    String str = "";	    str = "DeliveryAddress ( "	        + "id = " + this.id + tab	        + "orderInfoId = " + this.orderInfoId + tab	        + "seq = " + this.seq + tab	        + "provinceCode = " + this.provinceCode + tab	        + "cityCode = " + this.cityCode + tab	        + "districtCode = " + this.districtCode + tab	        + "address = " + this.address + tab	        + " )";		    return str;	}}